import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const AjouterSt = (props) => {
    const [NouveauStg,SetNouveauStg]=useState(  [
        {
        id:1,
        nom:"chaimae",
        prenom:"chaire",
        email:"chaimae@gmail.com",
        image:"femme1.PNG"
    },
    {
        id:2,
        nom:"aya",
        prenom:"sendi",
        email:"aya@gmail.com",
        image:"femme2.PNG"
    }])
    
    const navigate=useNavigate()
    function ajouterStg(){
        props.ajouter(NouveauStg);
        SetNouveauStg({id:NouveauStg.id +1,nom:"",prenom:"",image:"",email:""})
        navigate("/")
    }
    return (
        <>
            <form>
                <fieldset>
                    <label> Image  : </label>
                    <input type='text' id='image'onChange={(e)=>SetNouveauStg({...NouveauStg,image: e.target.value})} /><br/>
                    <label> Nom : </label>
                    <input type='text' id='nom' onChange={(e)=>SetNouveauStg({...NouveauStg,nom: e.target.value})}/><br/>
                    <label> Prenom : </label>
                    <input type='text' id='prenom' onChange={(e)=>SetNouveauStg({...NouveauStg,prenom: e.target.value})}/><br/>
                    <label>Email : </label>
                    <input type='text' id='email' onChange={(e)=>SetNouveauStg({...NouveauStg,email: e.target.value})}/><br/>
                    <button type='button' onClick={ajouterStg}> Ajouter </button>
                </fieldset>
            </form>
        </>
    );
}

export default AjouterSt;
